import './App.css';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import CompShowUsers from './Users/ShowUsers';
import CompCreateUser from './Users/CreateUser';
import CompEditUsers from './Users/EditUsers';
import CompShowRecipes from './Recipes/ShowRecipes';
import CompCreateRecipes from './Recipes/CreateRecipes';
import CompEditRecipes from './Recipes/EditRecipes';
import Navbar from './components/Navbar';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <Navbar/>
        <Routes>
          {/* MENU PRINCIPAL */}
          <Route path='/' element={<CompShowDashboard/>}/>
          {/* RUTAS DE RECETAS */}
          <Route path='/recipes' element={<CompShowRecipes/>}/>
          <Route path='/recipes/create' element={<CompCreateRecipes/>}/>
          <Route path='/recipes/edit/:id' element={<CompEditRecipes/>}/>
          {/* RUTAS DE USUARIOS */}
          <Route path='/users' element={<CompShowUsers/>}/>
          <Route path='/users/create' element={<CompCreateUser/>}/>
          <Route path='/users/edit/:id' element={<CompEditUsers/>}/>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
